import{_ as t}from"./plugin-vue_export-helper-c27b6911.js";import{o as e,c as l,f as d}from"./app-4ed637ae.js";const o={},c=d('<p>正则是匹配模式，要么匹配字符，要么匹配位置。</p><h2 id="_1-字符匹配" tabindex="-1"><a class="header-anchor" href="#_1-字符匹配" aria-hidden="true">#</a> 1. 字符匹配</h2><p>横向模糊匹配：<code>{m,n}</code> 纵向模糊匹配：<code>[abc]</code></p><ul><li><p>字符组：</p><ul><li><p>范围表示法</p><ul><li><code>[123456ancdefGHIJKLM]</code> 可以写成 <code>[1-6a-fG-M]</code></li><li>要表示 <code>a</code>、<code>-</code>、<code>z</code> 三个字符中的一个，可以写成 <code>[-az]</code> 或 <code>[az-]</code> 或 <code>[z\\-z]</code></li></ul></li><li><p>排除字符组</p><ul><li><code>[^abc]</code> 表示除了 <code>a</code>、<code>b</code>、<code>c</code> 之外的任意字符</li></ul></li><li><p>常见简写</p><table><thead><tr><th style="text-align:left;">字符组</th><th style="text-align:left;">含义</th></tr></thead><tbody><tr><td style="text-align:left;">\\d</td><td style="text-align:left;">表示 [0-9]。</td></tr><tr><td style="text-align:left;">\\D</td><td style="text-align:left;">表示 [^0-9]。表示除数字外的任意字符。</td></tr><tr><td style="text-align:left;">\\w</td><td style="text-align:left;">表示 [0-9a-zA-Z_]。表示数字、大小写字母和下划线。</td></tr><tr><td style="text-align:left;">\\W</td><td style="text-align:left;">表示 [^0-9a-zA-Z_]。非单词字符。</td></tr><tr><td style="text-align:left;">\\s</td><td style="text-align:left;">表示 [ \\t\\v\\n\\r\\f]。表示空白符，包括空格、水平制表符、垂直制表符、换行符、回车符、换页符。</td></tr><tr><td style="text-align:left;">\\S</td><td style="text-align:left;">表示 [^ \\t\\v\\n\\r\\f]。 非空白符。</td></tr><tr><td style="text-align:left;">.</td><td style="text-align:left;">表示 [^\\n\\r\\u2028\\u2029]。通配符，几乎任意字符。换行符、回车符、行分隔符和段分隔符除外。</td></tr></tbody></table><ul><li>匹配任意字符：<code>[\\d\\D]</code>、<code>[\\w\\W]</code>、<code>[\\s\\S]</code>、<code>^</code></li></ul></li></ul></li><li><p>量词（惰性）：</p><table><thead><tr><th style="text-align:left;">量词</th><th style="text-align:left;">含义</th></tr></thead><tbody><tr><td style="text-align:left;">{m,}</td><td style="text-align:left;">表示至少出现 m 次。</td></tr><tr><td style="text-align:left;">{m}</td><td style="text-align:left;">等价于 {m,m}，表示出现 m 次。</td></tr><tr><td style="text-align:left;">?</td><td style="text-align:left;">等价于 {0,1}，表示出现或者不出现。</td></tr><tr><td style="text-align:left;">+</td><td style="text-align:left;">等价于 {1,}，表示出现至少一次。</td></tr><tr><td style="text-align:left;">*</td><td style="text-align:left;">等价于 {0,}，表示出现任意次，有可能不出现。</td></tr></tbody></table><ul><li>惰性量词 &amp; 贪婪量词：上面的两次都进行贪婪匹配，在量词后加个 <code>?</code> 可实现惰性匹配</li></ul></li><li><p>多选分支（惰性）：<code>(p1|p2|p3)</code></p></li></ul><h2 id="_2-位置匹配" tabindex="-1"><a class="header-anchor" href="#_2-位置匹配" aria-hidden="true">#</a> 2. 位置匹配</h2><p>6 个锚：</p><ul><li><code>^</code>：行开头。</li><li><code>$</code>：行结尾。</li><li><code>\\b</code>：单词边界，即 <code>\\w</code> 和 <code>\\W</code> 之间的位置，也包括 <code>\\w</code> 和 <code>^</code> 之间的位置，也包括 <code>\\w</code> 与 <code>$</code> 之间的位置。</li><li><code>\\B</code>：非单词边界。具体说来就是 <code>\\w</code> 与 <code>\\w</code>、 <code>\\W</code> 与 <code>\\W</code>、<code>^</code> 与 <code>\\W</code>，<code>\\W</code> 与 <code>$</code> 之间的位置。</li><li><code>(?=p)</code>：其中 <code>p</code> 是一个子模式，整体指 <code>p</code> 前面的位置，或者说该位置后面要匹配 <code>p</code>。</li><li><code>(?!p)</code>：与 <code>(?=p)</code> 相反。</li></ul><blockquote><p><code>(?=p)</code> 和 <code>(?!p)</code> 分别叫 positive lookahead 和 negative lookahead，ES 5 之后还支持 positive lookbehind 和 negative lookbehind，分别为 <code>(?&lt;=p)</code> 和 <code>(?&lt;!p)</code></p></blockquote><pre><code>::: code-tabs#锚\n@tab `^`和`$`\n```js\nresult = &quot;hello&quot;.replace(/^|$/g, &#39;#&#39;);\nconsole.log(result);\n// =&gt; &quot;#hello#&quot;\n```\n\n@tab `\\b`\n```js\nlet result = &quot;[JS] Lesson_01.mp4&quot;.replace(/\\b/g, &#39;#&#39;);\nconsole.log(result);\n// =&gt; &quot;[#JS#] #Lesson_01#.#mp4#&quot;\n```\n\n@tab `\\B`\n```js\nlet result = &quot;[JS] Lesson_01.mp4&quot;.replace(/\\B/g, &#39;#&#39;);\nconsole.log(result);\n// =&gt; &quot;#[J#S]# L#e#s#s#o#n#_#0#1.m#p#4&quot;\n```\n\n@tab `(?=p)`\n```js\nlet result = &quot;hello&quot;.replace(/(?=l)/g, &#39;#&#39;);\nconsole.log(result);\n// =&gt; &quot;he#l#lo\n```\n\n@tab `(?!p)`\n```js\nlet result = &quot;hello&quot;.replace(/(?!l)/g, &#39;#&#39;);\nconsole.log(result);\n// =&gt; &quot;#h#ell#o#&quot;\n```\n:::\n</code></pre>',9),n=[c];function a(i,s){return e(),l("div",null,n)}const u=t(o,[["render",a],["__file","index.html.vue"]]);export{u as default};
